interface types {
    assertNumber(input: *): number;
    assertInt(input: *): number;
    assertString(input: *): string;
    assertBoolean(input: *): boolean;
    assertBigInt(input: *): bigint;
    assertSymbol(input: *): symbol;
    assertUndefined(input: *): undefined;
    assertFunction(input: *): function;
    assertObject(input: *): object;
}

